import math

def find_primes(lower, upper):
    """"""

    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True
    primes = [num for num in range(lower, upper + 1) if is_prime(num)]
    return primes
